import React from "react";
import amazon_banner from "./amazon_banner.jpg";
import "./Home.css";
import Product from "./Product";

function Home() {
  return (
    <div className="home">
      <img className="home__image" src={amazon_banner} alt="" />

      <Product
        id="12321341"
        title="Awesome Glasse"
        price={11.96}
        rating={5}
        image="https://images-na.ssl-images-amazon.com/images/I/61I1cI2mSgL._AC_SX679_.jpg"
      />
    </div>
  );
}

export default Home;
